import { useNavigate } from "react-router-dom";

function SearchOp(props) {
  const navigate = useNavigate();
  return (
    <div
      className=" w-56  bg-white rounded-md font-bold font-dmbold px-2"
      onClick={() => {
        navigate("/product");
      }}
    >
      {props.da?.name}
    </div>
  );
}
export default SearchOp;
